B.Jy=new A.aQ("Ik vond het seminarie over het algemeen zeer boeiend en heb er ook een aantal dingen uit opgestoken. Vooral het hele \u201cdouble diamond\u201d concept vond ik zeer interessant, omdat het een goede manier is om verschillende problemen op te sommen en op te lossen terwijl er rekening wordt gehouden met alle belangrijke stakeholders van het project. Helaas was niet alles nieuw, vooral het laatste deel van het seminarie was voor een groot deel al gekende informatie. Dit betekent natuurlijk niet dat er niks nieuws werd verteld. Het helpte mij zeker om concepten die al eens besproken waren in de lessen op een andere manier uitgelegd te krijgen. Dit is handig om een andere visie op een onderdeel te krijgen, waardoor het voor mij ook duidelijker werd hoe hetgeen ik leerde in de lessen ook gebruikt kan worden in een professionele omgeving. De reden waarom ik besloten heb om dit seminarie in verder detail te bespreken is omdat ik, als AON\u2019er, in eerste instantie het nut van concepten zoals scrum of LEAN niet belangrijk vond. Na het seminarie bij te wonen is mijn visie hierop volledig veranderd. Ik heb zo ook ontdekt dat ik vaak belangrijke onderdelen van het ontwikkelingsproces over het hoofd zag en mij teveel focuste op het programmeren, niet op de voorafgaande stappen. In toekomstige projecten zal ik er dan ook zeker meer aandacht aan besteden om eerst de nodige analyse te doen. Mogelijk zal ik ook zelf gebruikmaken van concepten die besproken werden in het seminarie zoals de \u201cdouble diamond\u201d.",null,null,null,null,null)
