B.Ju=new A.aQ("Het seminarie werd online gegeven via een teams meeting op 23 februari 2021 door Pieter Portauw van Craftworkz. Craftworkz maakt deel uit van de Cronos Group. Dit is een groep van bedrijven met als focus innovatieve technologie\xebn zoals: blockchain, AI, VR,... Dhr. Portauw zijn functie binnen het bedrijf is technical architect en SCRUM master.",null,null,null,null,null)
