B.IY=new A.aQ("Om even terug te reflecteren, op toch wel mijn favoriete activiteit gedurende het I-Talent traject, Flutter leren is \xe9\xe9n van de beste dingen die ik had kunnen doen tijdens mijn vrije tijd. Ik heb hier al meerdere applicaties mee kunnen maken en het heeft er ook voor gezorgd dat mijn kennis op andere vlakken van mobiele ontwikkeling enorm gestegen is. Ik heb bijvoorbeeld leren werken met de Google Play Console, Firebase en UI/UX guidelines van mobiele applicaties. Natuurlijk was het geen simpel traject om af te leggen en al zeker niet omdat ik niemand had om vragen aan te stellen. Het was een hele periode van \u201ctrial and error\u201d om tot dit punt te komen. Het grote voordeel van Flutter te leren is ook dat ik mij nu een volwaardige fullstack developer kan noemen, aangezien ik websites, backend systemen, databases EN mobiele applicaties kan maken. Het heeft mij ook het nut van geleerd van \u201cclean code\u201d, omdat in Flutter, met de grote hoeveelheid geneste \u201cwidgets\u201d het anders soms te moeilijk wordt om alles nog te begrijpen. Ook een goede state management is zeer belangrijk in Flutter, dit heb ik ontdekt op de harde manier, waarbij mijn applicaties heel traag waren ik niet wist waarom, tot ik erachter kwam dat ik een oneindig lange loop had waarbij het mijn UI refreshten\u2026 Ook andere aspecten van code zoals design patterns heb ik geleerd dankzij Flutter. Een simpel voorbeeld hiervan is het \u201cSingleton\u201d design pattern. Ik ben dan ook zeker van plan in de toekomst projecten verder uit te werken in Flutter. Ik heb dit zelfs al gedaan bij mijn vakantiewerk! Daarbij heb ik al een applicatie mogen uitbouwen in Flutter nadat ik het geleerd had. Het is naar mijn mening gewoon \xe9\xe9n van de snelste manieren om een cross-platform mobiele applicatie op te bouwen. Ook al ken ik op dit moment andere frameworks (zoals React Native). Ik blijf Flutter verkiezen.",null,null,null,null,null)
B.CF=new A.au(B.r,B.IY,null)
B.J9=new A.aQ("Gedurende het seminarie werd er vooral verwacht dat wij zelf input gaven bij de besproken topics. De spreker gaf een presentatie met verschillende voorbeelden vanuit het bedrijf zelf, maar er werd ook verwacht van ons om verdere voorbeelden aan te halen.",null,null,null,null,null)
B.CG=new A.au(B.S,B.J9,null)
B.J5=new A.aQ("Tenslotte de laatste stap \u201cproject\u201d. In deze stap begon ik aan het ontwikkelen van mijn eigen applicaties. Ik kan hierbij alvast vermelden dat ik op het moment van schrijven in het totaal 4 applicaties heb geschreven in Flutter, die ook beschikbaar zijn op de Google Play Store. In deze stap heb ik vooral gefocust op alles dat ik geleerd had in \u201ctutorial hell\u201d. Bij het eerste project heb ik nog veel moeten troubleshooten, maar dat minderde naarmate ik meer ervaring kreeg in het ontwikkelingsproces.",null,null,null,null,null)
B.CH=new A.au(B.r,B.J5,null)
B.Jz=new A.aQ("Na het be\xebindigen van de analyse stap ben ik beland in de zogenaamde \u201ctutorial hell\u201d. Dit hield dus, zoals de naam het zegt, vooral in dat ik tutorials bekeek om hieruit te leren. De tutorial die mij het meest geholpen heeft is \u201cFlutter & firebase app\u201d door \u201cThe Net Ninja\u201d op YouTube. Via deze tutorial leerde ik stapsgewijs hoe ik gebruik kon maken van Firebase in Flutter. Ook werd er de nodige aandacht besteed aan Flutter en Dart, waardoor ik als beginner alles kon volgen en snel kon bijleren. Andere bronnen die ik bezocht waren StackOverflow, open-source projecten en \u201cWidget of the week\u201d door het team van Flutter.",null,null,null,null,null)
B.CI=new A.au(B.r,B.Jz,null)
B.Jc=new A.aQ("Vervolgens werden \u201cReplicaSets\u201d besproken. Deze kunnen worden gebruikt om \u201cpods\u201d te beheren. Ze zorgen ervoor dat er op ieder moment altijd het gegeven aantal \u201cpods\u201d actief is. Als bijvoorbeeld een \u201cpod\u201d zou crashen dan zorgt dit ervoor dat er direct een nieuwe opgestart wordt. Een verdere uitbreiding hierop die ook gezien werd is \u201chorizontal pod autoscaling\u201d. Dit betekent in simpele termen gewoon dat er a.d.h.v. \u201cmetrics\u201d zoals CPU gebruik er \u201cpods\u201d toegevoegd of verwijderd worden. Verder kregen we nog uitleg over de verschillende services zoals \u201cClusterIP\u201d, \u201cNodePort\u201d en \u201cLoadBalancer\u201d. Een \u201cClusterIP\u201d is een standaard service dat ervoor zorgt dat er een interne \u201csingle point of access\u201d is voor een groep \u201cpods\u201d m.a.w. de \u201cpods\u201d kunnen bereikt worden via \xe9\xe9n IP met \xe9\xe9n poort i.p.v. over meerdere verschillende IP\u2019s en poorten. \u201cNodePort\u201d, daarentegen zorgt ervoor dat applicaties buiten de cluster een groep van pods kan bereiken door op iedere \u201cpod\u201d \xe9\xe9n poort open te zetten. In theorie is dat geen goed idee omdat het de service kwetsbaar maakt voor aanvallen. Daarom wordt er vaak geopteerd voor een \u201cLoadBalancer\u201d. Deze wordt vaak ge\xefmplementeerd op services zoals Google Cloud. De \u201cLoadBalancer\u201d zorgt voor 1 poort waarop de applicatie bereikt kan worden. Om het seminarie af te ronden hebben wij nog een snelle uitleg gekregen over Google Cloud en hoe dat een \u201cLoadBalancer\u201d hierop kan worden ingesteld. Dit gebeurde a.d.h.v. een live demo en hebben wij dus zelf niet lokaal kunnen doen.",null,null,null,null,null)
B.CK=new A.au(B.r,B.Jc,null)
B.J3=new A.aQ("Om het analyse onderdeel af te ronden heb ik ook gekeken naar de programmeertaal van Flutter, Dart. Ook dit heb ik gedaan door op een redelijk snelle manier over de offici\xeble documentatie te gaan. Hierin heb ik vooral gelet op wat er verschillend is van andere \u201cstatically typed languages\u201d zoals bijvoorbeeld: Java. E\xe9n van de grootste verschillen is dat Dart geen interfaces heeft.",null,null,null,null,null)
B.CL=new A.au(B.r,B.J3,null)
B.Jk=new A.aQ("Het volgende onderdeel, LEAN, gaf uitleg over hoe de manier van denken bij het oplossen van een probleem de focus moet leggen op de gebruikers. Het bedenken van kleinschalige experimenten om te weten of een product \u2018market fit\u2019 is was \xe9\xe9n van de mogelijk stappen. Het concept minimum viable product (MVP) werd ook uitgelegd. Dit was geen nieuw idee voor mij, maar het gaf wel een beter inzicht in waarom dit belangrijk is. Tenslotte werd agile besproken. Agile was een gekend idee dankzij de opleidingsonderdelen: devops en software analysis. Er werd vooral besproken wat agile is en hoe het gebruikt kan worden. Ook verschilllende methodologie\xebn zoals scrums en kanbanborden kregen een plaats in de presentatie.",null,null,null,null,null)
B.CM=new A.au(B.S,B.Jk,null)
B.IZ=new A.aQ("Het seminarie bestond voor een groot deel uit theoretische uitleg. Dit betekent dus dat er niet veel was dat ik kon doen behalve op te letten en eventuele vragen te stellen. De presentatie werd opgedeeld in 3 pijlers: design thinking, LEAN en agile. Gedurende de hele presentatie werd dan ook bij alles de focus gelegd op \xe9\xe9n of meerdere van deze pijlers.",null,null,null,null,null)
B.CN=new A.au(B.S,B.IZ,null)
B.Jl=new A.aQ("De derde en laatste activiteit waarvoor ik gekozen heb een uitgebreid verslag te schrijven is een eigen extra activiteit: \u201cFlutter\u201d. Voor de start van deze activiteit was mijn doel om uiteindelijk genoeg te weten over Flutter om een mobiele applicatie te schrijven.",null,null,null,null,null)
B.CO=new A.au(B.r,B.Jl,null)
B.J0=new A.aQ("Het seminarie kon opgedeeld worden in 4 delen: Docker, Kubernetes, workshop en Google Cloud. Het eerste deel, Docker, ging over de basisconcepten van Docker. Hierbij kregen we uitleg over hoe Docker werkt a.d.h.v. een powerpoint. Vervolgens kregen we stapsgewijs uitleg over Kubernetes. Per onderdeel van Kubernetes werd er verwacht dat we de bijbehorende oefening maakte. Deze werd dan vervolgens ook nog eens opgelost voor de klas door dhr. van Bael. Deze manier van werken zorgden ervoor dat wij op een zelfstandige manier Kubernetes konden leren. Hierdoor was er ook de mogelijkheid om \xe9\xe9n-op-\xe9\xe9n vragen te stellen. Het zorgde er verder ook voor dat de verschillende concepten makkelijker te onthouden waren aangezien we deze allemaal apart bekeken i.p.v. in \xe9\xe9n keer. Ook kon ik tijdens het seminarie aandachtiger volgen, omdat de theoretische delen onderbroken werden door de praktische oefeningen. Een aantal van de besproken concepten zijn: Pods, ReplicatSets, NodePort, ClusterIP, Load Balancing,... Een groot deel van deze concepten werden eerst uitgelegd a.d.h.v. een presentatie en vervolgens a.d.h.v de bijgeleverde GitHub repository werd alles nog eens in detail besproken.",null,null,null,null,null)
B.CP=new A.au(B.r,B.J0,null)
B.Jo=new A.aQ("Tijdens het traject heb ik mij gefocust op het worden van een excellente professional a.d.h.v. de gekende X-Factor. Deze doelen heb ik dan ook bereikt, mede dankzij de georganiseerde seminaries van PXL. Bij de keuze van mijn seminaries heb ik ook vooral gekozen voor seminaries die mij iets nieuws aanleerde, waarmee ik niet direct in aanraking kwam binnen mijn keuzetraject, bijvoorbeeld: Kubernetes. Om mij verder te onderscheiden heb ik buiten de \u201cverplichte\u201d activiteiten ook gewerkt aan mijn eigen kennis. Hierdoor voel ik mij een meer volwaardig full stack ontwikkelaar. Natuurlijk tijdens het opdoen van zoveel kennis is het ook goed om dit te delen met andere. Ik heb mij dan ook ingezet in het ondersteunen van en bijles geven aan anderen, ook al was het maar voor een zeer korte periode, omwille van o.a. tijdsgebrek en ook aangezien de persoon waaraan ik bijles gaf geen verdere interesse had in programmeren. Ik heb ook voor het eerst bijgedragen aan de open-source community door het maken van een publiek beschikbare package voor Flutter. Dit was een nieuwe ervaring voor mij aangezien dit iets is wat ik nog nooit gedaan had. Hiermee wou ik mijn kennis voor het oplossen van een specifiek probleem delen met iedereen hetzelfde probleem heeft. Gedurende het proces heb ik geleerd hoe ik mijn grenzen kan verleggen om nieuwe dingen bij te leren. Dit vereist uiteraard veel discipline om het vol te houden, maar hier heb ik nooit problemen mee gehad. Ik heb al sinds jongs af aan een echte werkersmentaliteit voor de verschillende dingen die mij interesseren, zoals: sport en IT. Ik heb tijdens mijn opleidingsjaren ook ontdekt hoe ik kan meehelpen aan het oplossen van de problemen a.d.h.v. het bijdragen open-source packages en projecten. Dit wil ik ook zeker in de toekomst blijven doen, waar mogelijk. Gedurende mijn stage waarin ik aan het ontwikkelen ben in Laravel heb ik ook mijn tweede package \u201cFuzzyness\u201d beschikbaar gesteld voor PHP ontwikkelaars. In de toekomst ben ik ook van plan dit te blijven doen, om mensen met dezelfde problemen een oplossing aan te bieden. Helaas door o.a. corona heb ik vooral bijdragen moeten leveren op deze manier, aangezien het moeilijk was om samen te komen met andere om samen te netwerken en idee\xebn te delen. Hopelijk in de toekomst kan dit wel weer. Ik ben dan ook van plan om mijn netwerk van zowel connecties als kennis uit te breiden in de nabije toekomst. Als IT-er is er ook nooit een einde aan het leren. Er is altijd wel iets nieuws om te ontdekken. Een aantal dingen waar ik bijvoorbeeld mij nog in wil verdiepen zijn: blockchain en investeren. Om iets specifieker zijn, bij blockchain gaat het vooral over de werking en technologie hiervan en bij investeren ben ik vooral ge\xefnteresseerd in het lezen en begrijpen van de grafieken om zo een gerichte voorspelling te maken van prijsacties. Helaas is een vaak terugkerend probleem: de balans zoeken tussen mijn geplande activiteiten en de tijd om nieuwe dingen te ontdekken, hieraan moet ik duidelijk nog werken in de toekomst, maar ik zie dit eerder als een extra uitdaging en niet zozeer als een probleem.",null,null,null,null,null)
B.CQ=new A.au(B.r,B.Jo,null)
B.Js=new A.aQ("Bij design thinking werd de focus gelegd op de vraag: \u201cwat is het probleem?\u201d en niet zozeer op een oplossing voor dit probleem. Hierbij werd besproken dat er voor ieder probleem een balans gezocht moet worden tussen UX, marketing sales en engineering. Ieder onderdeel had ook zijn eigen bijbehorende vraag. UX legt de focus op wat de user wilt. Marketing sales kijkt eerder naar wat het meest winstgevend is. Tenslotte engineering bekijkt wat ook mogelijk is. Het werd al snel duidelijk dan de balans tussen de 3 compleet verschillende vragen vinden niet evident is. Gelukkig is er een oplossing. De spreker gaf uitleg bij de oplossing: de \u201cdouble diamond\u201d. Dit design procesmodel  maakt gebruik van 4 stappen om het probleem op te lossen namelijk: discover, define, design en decide. Bij \u201cdiscover\u201d onderzoekt men wat de context is en bijgevolg wie de belangrijkste stakeholders zijn. Het doel hiervan is om een lijst op te stellen met problem die er opgelost moeten worden. Vervolgens gaat \u201cdefine\u201d gaat proberen deze lijst verder te verfijnen om dan vervolgens over te gaan naar het \u201cdesign\u201d gedeelte. Hierin wordt er voor het eerst nagedacht over de mogelijke oplossingen voor de problemen. Het is dan ook goed mogelijk dat er al eerste schetsen worden gemaakt om alles te verduidelijken. Tenslotte bij \u201cdecide\u201d gaat er gekozen worden voor een mogelijke oplossing. Hierbij gaan ook de belangrijkste voordelen van het eindproduct genoteerd worden.\n                ",null,null,null,null,null)
B.CR=new A.au(B.S,B.Js,null)
B.Jr=new A.aQ("Dit seminarie was \xe9\xe9n van de weinige seminaries die ik fysiek heb kunnen bijwonen. Het seminarie werd gegeven op 10 november 2021 op PXL. Dries van Bael, Google cloud engineer bij Devoteam, kwam een hands-on sessie geven in het thema van Kubernetes.",null,null,null,null,null)
B.CS=new A.au(B.r,B.Jr,null)
B.Jx=new A.aQ("Ik ben zeer tevreden dat ik dit seminarie had gekozen. Het was voor mij persoonlijk het seminarie dat mij het meeste interesseerde, omdat ik al een tijdje wou bijleren over Kubernetes. Zelf vond ik het moeilijk om Kubernetes te leren in mijn vrije tijd, omdat ik niet de nodige bronnen wist te vinden. Dankzij de uitleg van een professional was het veel makkelijker om de verschillende concepten te begrijpen. Het heeft dan ook aan al mijn wensen gedaan. Ik heb de hoofdbegrippen van Kubernetes geleerd en ook al eens een eerste \u201capplicatie\u201d ermee opgebouwd. Ik vond het ook interessant om de verschillende mogelijkheden van Kubernetes te ontdekken. Het hands-on principe had ook zijn voordelen, omdat ik op deze manier op mijn eigen tempo alle concepten kon doorlopen en leren begrijpen. Docker was voor mij al een bekend iets. Dit is deels dankzij de lessen van DevOps, maar ook het IT project waarbij ik meerdere Docker containers heb opgebouwd voor mijn team. Ik wist al op voorhand dat Kubernetes hier ook gebruik van zou maken, maar ik had niet verwacht het er volledig afhankelijk van is. Ik heb dan ook deze activiteit verder besproken, omdat dit eerder een typisch onderwerp is voor SNB-studenten en ik, als AON-student, hier veel minder mee in aanraking kom.  Of ik het in mijn eigen projecten zal gaan gebruiken, daar ben ik nog niet zeker van. Dit is niet omdat ik het niet interessant of nutteloos vind, maar vaak zijn de projecten die ik maak kleinschaliger en is er dus geen grote nood aan een grote cluster om alles te beheren. Meestal is enkel een simpele Docker container genoeg, maar wie weet kom ik er nog wel eens mee in aanraking als ik aan grotere projecten werk, dus ik zou het zeker nog niet afschrijven.",null,null,null,null,null)
B.CT=new A.au(B.r,B.Jx,null)
B.J6=new A.aQ("Vooraleer ik begin met hoe ik Flutter heb geleerd, wil ik eerst uitleggen waarom ik besloten heb Flutter te leren. Ik ben altijd al ge\xefnteresseerd geweest in mobiele applicaties, maar na een beetje onderzoek te doen hierover zijn er een aantal nadelen. Om te beginnen, om \u201cnative\u201d te ontwikkelen is er nood aan verschillende dingen. Om voor Android te ontwikkelen moet er gebruikgemaakt worden van Kotlin of Java en voor iOS zal er gebruikgemaakt moeten worden van Swift of Objective-C. Dit betekent dus al dat er direct 2 talen zijn die geleerd moeten worden om voor beide besturingssystemen een applicatie te ontwikkelen. Een volgend probleem voor mij persoonlijk is dat voor iOS ontwikkeling er nood is aan XCode waarvoor op zijn beurt ook weer nood is aan een Mac OS toestel en eventueel een iPhone. Deze heb ik niet. Dan zou je denken, waarom dan niet gewoon Android ontwikkeling leren? Logisch toch? Klopt, maar ik wou ook verder kijken dan het heden, wat als ik een applicatie maak die ik ook beschikbaar wil maken voor iOS? Dan moet ik weer terug van het begin een applicatie maken. Na verder onderzoek ben ik dan uitgekomen bij een aantal opties: Cordova, Xamarin, Flutter en React Native. Cordova had ik al eens in het verleden gebruikt, omdat ik toen enkel HTML, CSS en Javascript kon, maar het gebruik van Cordova viel een beetje tegen toen. Zo werkte mijn applicatie niet zoals ik zou verwachten op alle schermgroottes en de verschillende versies van Android. Xamarin heb ik ook redelijk vroeg afgeschreven. Dit was vooral omdat het gebruikmaakt van .NET (C#). Deze taal kan ik wel, maar ik ben er geen liefhebber van. Xamarin werd ook uitgelegd in de lessen van .NET, dus om deze in mijn vrije tijd nog te leren leek mij niet zo interessant. Toen was het de keuze nog maken tussen Flutter (van Google) of React Native (van Facebook). In eerste instantie wou ik gebruikmaken van React Native, omdat ik hierover al veel gehoord had en ik had de skills ervoor (nl.: HTML, CSS, Javascript/React). Uiteindelijk heb ik toch besloten om Flutter te kiezen. Hiervoor waren 3 redenen. De eerste was dat Flutter geen gebruikmaakt van een \u201cJavascript bridge\u201d, maar een eigen C++ rendering engine om de een applicatie voor ieder platform te ontwikkelen, bijgevolg is Flutter in theorie ook sneller. De 2e reden is de grootte van een app. Flutter applicaties hebben een kleinere bestandsgrootte. Dit is voor mij een zeer belangrijk iets, aangezien ik graag klein, lightweight apps wil ontwikkelen die niet al te veel opslag in beslag nemen. Tenslotte maakt Flutter gebruik van \u201cDart\u201d als programmeertaal. Als ik Dart moet beschrijven dan zou ik zeggen dat het een combinatie van C# en Javascript is. Deze taal was toen nieuw voor mij en ik vond het wel interessant, aangezien ik toch iets nieuws ging leren, om het dan ook te kiezen voor iets dat volledig nieuw was.",null,null,null,null,null)
B.CU=new A.au(B.r,B.J6,null)
B.Jq=new A.aQ("Als eerste activiteit zal ik het hebben over \u201cCraftworkz: From idea to solution\u201d. Mijn doel hierbij was om een beter inzicht te krijgen in hoe het proces van het bedenken en het ontwikkelen van een applicatie in elkaar zit.",null,null,null,null,null)
